import { ADD_DIARY } from '../actions/types';

const initialState = {
    diaries: [],
    loading: false
}

export default function diaryReducer (state = initialState, action) {
    switch (action.type) {
        case ADD_DIARY:
            console.log(action);
           return {
            ...state,
            diaries: [action.payload, ...state.diaries]
           }
        default:
            return state;
    }
}
